    return (
        <div className="my-container">
            <Typography variant='h6'>Load My Engine</Typography>
            <DropzoneArea className='drop-zone' />
            <Button variant="outlined" color='primary'>
                Construct Inverted Indicies
            </Button>
        </div>
    )
}
